### Description

After the tag [v2.0.0-beta.39.2](https://github.com/wailsapp/wails/releases/tag/v2.0.0-beta.39.2) toggling fullscreen causes a crash on linux.

As @leaanthony suggested in #1653 I did a git bisect and it seems that ae756a8409bce442c881e24cfe2a0430d603440f is the first bad commit.


### To Reproduce

1. Create a new Wails app.
2. Change the greet function to toggle the fullscreen mode:
```
JS code:

    import {WindowFullscreen, WindowUnfullscreen} from '../wailsjs/runtime/runtime'

    let fs = false;
    try {
        if (fs) {
            fs = false;
            WindowUnfullscreen();
        } else {
            fs = true;
            WindowFullscreen()
        }
    } catch (err) {
        console.error(err);
    }
```
3. Push the button 2-3 times and see the program exit.

### Expected behaviour

I expect the screen mode to be toggled.

