# Problem encountered
After trading termination is complete, the oracle termination spec **keeps sending the data every second or so**. 
In the likely situation where trading termination of a market and its settlement are one day in between, we will get 80+k transactions which are unnecessary.

Details below.

# Evidence
## Enact a market with a boolean termination spec and move to continuous trading. Event bus confirms activation of the specs.
