**To Reproduce**

**Just run the original example and wait till someone who is NOT in your contact posts a state.**

**Environment (please complete the following information):**
 - Is this on a server? No
 - What do your `connectOptions` look like? as same as the original example
 - Do you have multiple clients on the same IP? No
 - Are you using a proxy? No

**Additional context**
This issue is highly associated with the user's status especially if they save your contact while you are NOT storing him on your contacts.

https://github.com/concrete5/concrete5/blob/f8541c52a73b20e19477ecddfb4eae096cf1af4d/concrete/attributes/select/controller.php#L587

The function says that if no matching select option is found, then simply do not apply the filter... this is not really the right way to do this, as it means it is impossible to return an empty result set in the case of no pages matching.

The function should read more like the below - may be a better way to do this, but just a quick fix I did for my current client


    public function filterByAttribute(AttributedItemList $list, $value, $comparison = '=')
    {
        $em = \Database::connection()->getEntityManager();
        if ($value instanceof SelectValueOption) {
            $option = $value;
        } else {
            $option = $em->getRepository('\Concrete\Core\Entity\Attribute\Value\Value\SelectValueOption')
                ->findOneByValue($value);
        }

        $column = 'ak_' . $this->attributeKey->getAttributeKeyHandle();
        $qb = $list->getQueryObject();
        $qb->andWhere(
            $comparison === '!=' || $comparison === '<>'
                ? $qb->expr()->notLike($column, ':optionValue_' . $this->attributeKey->getAttributeKeyID())
                : $qb->expr()->like($column, ':optionValue_' . $this->attributeKey->getAttributeKeyID())
        );
        if (is_object($option)) {
            $qb->setParameter('optionValue_' . $this->attributeKey->getAttributeKeyID(), "%\n" . $option->getSelectAttributeOptionValue(false) . "\n%");
        }else{
            // null out the actual value somehow - probably a better way to do this.
            $qb->setParameter('optionValue_' . $this->attributeKey->getAttributeKeyID(), "%\n" . "\n%");
        }
    }

